import { connect } from 'react-redux';
import React, { Component } from 'react';
import { Row,Form, FormGroup, Col, CardBody } from 'reactstrap';
import DbCrud from '../../../Pojo/DbCrud';

var flat = true;

class Edit extends Component {

  constructor(props) {
    super(props);
    this.state = {
      orders: {
        pag:"1",
        limit:"20",
        filFile:"order",
        filValue: ""+this.props.match.params.Order,
        sorts:[
          {
            file:"oderDate",
            value:1
          }
        ]
      }
    }

  }

  /**Metodo que se ejecuta automaticamente cada vez que el componente es llamado */
  componentDidMount() {
    if (flat) {
      flat = false;
      this.props.loadReducer('loadOrders', "orders/find",this.state.orders);
    }
  }

  callList() { 
    this.props.history.push('/Orders/List'); 
  }

  callSave(e) {
    e.preventDefault();
    //this.props.update('updateGeo', "geo", "CountriesList", this, this.state.documentId);
    this.props.history.push('/Orders/List');
  }

  formOrders(){
    const node = this.props.obj.listOrders;


    Object.keys(node).forEach(function(key){
      console.log(key);
    })

    return(
      <CardBody>
          <Form action="" onSubmit={this.onFormSubmit} method="post" className="form-horizontal">
              <FormGroup row>
              <Col xs="12" md="12">
                  <Row>
                    <Col>sdfs</Col><Col>hola</Col>
                  </Row>
              </Col>
              </FormGroup>
          </Form>
      </CardBody>
    )
  }

  render() {

    return (
      <div className="animated fadeIn">
        {this.formOrders()}
      </div>
    );
  }

}

const mapStateToProps = (state) => {
  //Registra el objeto la funcion que cargara el objeto en el estado
  return{
    obj:state.DaoOrders
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    loadReducer: (type, colletion, body) => {
      DbCrud.dbMLoad(dispatch, type, colletion, body);
    }
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(Edit);
